import React, { useEffect, useState } from "react";
import "./box.css";
import Icon from "./icon.js";

export default function box(props) {
  const Pi = props.pieces;
  let image = null;
  let x1 = null;
  let x = 0,
    y = 0,
    idx = -1;
  let c = "no";
  for (var i = 0; i < Pi.length; i++) {
    if (Pi[i].x == props.row && Pi[i].y == props.column) {
      image = Pi[i].image;
      x = Pi[i].x;
      y = Pi[i].y;

      idx = i;
      c = Pi[i].c;
    }
  }
  const onDragStart = (e, idr, idc) => {
    console.log("drag start");
  };

  const onDragEnter = (e, idr, idc) => {
    // console.log("drag enter");
    console.log(idr, idc);
    const piece = document.getElementById(`${Pi[idx].c}${x}${y}`);
    const tile = document.getElementById(`${idr}${idc}`);
    const pieceId = (value) => {
      return value.key = `${Pi[idx].c}${x}${y}`;
    };
    console.log(Pi.find(pieceId))
    // console.log(Pi)
  };

  const onDrop = (e) => {
    console.log("drag drop");
  };
  const handlePiece = (e) => {
    e.preventDefault();
    const Piece = {
      image:null,
      x:0,
      y:0,
      c:null,
      key:null
    }
    const ps=[];
    for(var i=1;i<=8;i++){
      ps.push({image:require('../images/Chess_pdt60.png'),x:2,y:i,c:'d'});
    }
    for(var i=3;i<=6;i++){
      for(var j=1;j<=8;j++){
        if((i+j)%2===0){
          ps.push({image:null,x:i,y:j,c:'n'});
        }
      }
    }
    for(var i=3;i<=6;i++){
      for(var j=1;j<=8;j++){
        if((i+j)%2!=0){
          ps.push({image:null,x:i,y:j,c:'n'});
        }
      }
    }
    ps.push({image:require('../images/Chess_rdt60.png'),x:1,y:1,c:'d'});
    ps.push({image:require('../images/Chess_rdt60.png'),x:1,y:8,c:'d'});
    ps.push({image:require('../images/Chess_bdt60.png'),x:1,y:3,c:'d'});
    ps.push({image:require('../images/Chess_bdt60.png'),x:1,y:6,c:'d'});
    ps.push({image:require('../images/Chess_ndt60.png'),x:1,y:2,c:'d'});
    ps.push({image:require('../images/Chess_ndt60.png'),x:1,y:7,c:'d'});
    ps.push({image:require('../images/Chess_qdt60.png'),x:1,y:4,c:'d'});
    ps.push({image:require('../images/Chess_kdt60.png'),x:1,y:5,c:'d'});
    ps.push({image:require('../images/Chess_rlt60.png'),x:8,y:8,c:'l'});
    ps.push({image:require('../images/Chess_rlt60.png'),x:8,y:1,c:'l'});
    ps.push({image:require('../images/Chess_blt60.png'),x:8,y:3,c:'l'});
    ps.push({image:require('../images/Chess_blt60.png'),x:8,y:6,c:'l'});
    ps.push({image:require('../images/Chess_nlt60.png'),x:8,y:2,c:'l'});
    ps.push({image:require('../images/Chess_nlt60.png'),x:8,y:7,c:'l'});
    ps.push({image:require('../images/Chess_qlt60.png'),x:8,y:4,c:'l'});
    ps.push({image:require('../images/Chess_klt60.png'),x:8,y:5,c:'l'});
    for(var i=1;i<=8;i++){
      ps.push({image:require('../images/Chess_plt60.png'),x:7,y:i,c:'l'});
    }

    const pii=props.pieces;
    ps[34].image=ps[40].image;
    ps[34].c=ps[40].c;
      props.Change(ps)
  };
  return (
    <>
      {(props.row % 2 === 0 && props.column % 2 === 1) ||
      (props.row % 2 === 1 && props.column % 2 === 0) ? (
        <div
          id={`${props.row}${props.column}`}
          className="color1"
          onDragStart={(e) => onDragStart(e, props.row, props.column)}
          onDragEnter={(e) => onDragEnter(e, props.row, props.column)}
          onClick={handlePiece}
          onDrop={onDrop}
          draggable="true"
        >
          {idx}
          <>
            {c != "n" ? (
              <img
                id={`${Pi[idx].c}${x}${y}`}
                draggable="true"
                className="chesbd"
                src={Pi[idx].image}
              />
            ) : (
              <div></div>
            )}
          </>
        </div>
      ) : (
        <div
          className="color2"
          id={`${props.row}${props.column}`}
          onDragStart={(e) => onDragStart(e, props.row, props.column)}
          onDragEnter={(e) => onDragEnter(e, props.row, props.column)}
          onDrop={onDrop}
          draggable="true"
        >
          {idx}
          <>
            {c != "n" ? (
              <img
                id={`${Pi[idx].c}${x}${y}`}
                onClick={handlePiece}
                draggable="true"
                className="chesbd"
                src={Pi[idx].image}
              />
            ) : (
              <div>{c}</div>
            )}
          </>
        </div>
      )}
    </>
  );
}
